PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?goat ?goatLabel ?goatImage ?startTime ( COALESCE ( ?endTime , NOW () ) AS ?finalEndTime ) WHERE {
  wd:Q104770 wdt:P822 ?goat .
  OPTIONAL {
    ?goat wdt:P18 ?goatImage
  }
  OPTIONAL {
    ?goat p:P822 / psv:P822 ?statement .
    ?statement pq:P580 ?startTime .
    OPTIONAL {
      ?statement pq:P582 ?endTime
    }
  }
  OPTIONAL {
    ?goat rdfs:label ?goatLabel .
    FILTER ( LANG( ?goatLabel ) = 'en' )
  }
}

