PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?inceptionYear ( COUNT( ?ensemble ) AS ?count ) WHERE {
  ?ensemble wdt:P31 / wdt:P279 * wd:Q200055 .
  OPTIONAL {
    ?ensemble wdt:P571 ?inceptionDate1 .
  }
  OPTIONAL {
    ?ensemble wdt:P580 ?inceptionDate2 .
  }
  OPTIONAL {
    ?ensemble wdt:P585 ?inceptionDate3 .
  }
  FILTER ( BOUND( ?inceptionDate1 ) || BOUND( ?inceptionDate2 ) || BOUND( ?inceptionDate3 ) ) BIND( COALESCE ( ?inceptionDate1 , ?inceptionDate2 , ?inceptionDate3 ) AS ?inceptionDate ) BIND( YEAR( ?inceptionDate ) AS ?inceptionYear ) FILTER NOT EXISTS {
    ?ensemble wdt:P582 ?endDate .
  }
}
GROUP BY ?inceptionYear
ORDER BY ?inceptionYear

