PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
SELECT ?country ?countryLabel ?capital ?capitalLabel ?currency ?currencyLabel ?population ?flagImage ?determinationMethod ?determinationMethodLabel WHERE {
  {
    SELECT ?country ?countryLabel ?capital ?capitalLabel ?currency ?currencyLabel ?population ?flagImage WHERE {
      ?country wdt:P31 wd:Q3624078 .
      ?country wdt:P36 ?capital .
      ?country wdt:P38 ?currency .
      ?country wdt:P1082 ?population .
      ?country wdt:P41 ?flagImage .
      FILTER NOT EXISTS {
        ?country wdt:P31 wd:Q3024240 .
      }
      FILTER NOT EXISTS {
        ?country wdt:P31 wd:Q34660 .
      }
      OPTIONAL {
        ?country rdfs:label ?countryLabel .
        FILTER ( LANG( ?countryLabel ) = "en" )
      }
      OPTIONAL {
        ?capital rdfs:label ?capitalLabel .
        FILTER ( LANG( ?capitalLabel ) = "en" )
      }
      OPTIONAL {
        ?currency rdfs:label ?currencyLabel .
        FILTER ( LANG( ?currencyLabel ) = "en" )
      }
    }
  } UNION {
    SELECT ?country ?determinationMethod ?determinationMethodLabel WHERE {
      VALUES ?country {
        wd:Q710 wd:Q423 wd:Q16 wd:Q34 wd:Q36 wd:Q222 wd:Q399 wd:Q213 wd:Q219060 wd:Q801
      }
      ?country p:P36 ?capitalStatement .
      ?capitalStatement pq:P459 ?determinationMethod .
      OPTIONAL {
        ?determinationMethod rdfs:label ?determinationMethodLabel .
        FILTER ( LANG( ?determinationMethodLabel ) = "en" )
      }
    }
  }
}
