PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?countryOrPart ?label ( ROUND( ?area ) AS ?roundedArea ) ?partOf WHERE {
  ?countryOrPart wdt:P30 wd:Q46 .
  OPTIONAL {
    ?countryOrPart wdt:P361 ?partOf .
  }
  ?countryOrPart rdfs:label ?label .
  FILTER ( LANG( ?label ) = "en" ) OPTIONAL {
    ?countryOrPart wdt:P2046 ?area .
  }
  FILTER NOT EXISTS {
    ?countryOrPart wdt:P576 ?dissolutionDate .
  }
  FILTER ( IF( BOUND( ?area ) , ?area > 10000 , false ) ) ?countryOrPart wdt:P31 ?instanceOf .
  FILTER ( ?instanceOf = wd:Q6256 || ?instanceOf = wd:Q11613 )
}
ORDER BY DESC ( ?roundedArea )

