SELECT DISTINCT ?entity ?population ?area ?populationDate WHERE {
  VALUES ?entity {
    wd:Q884 wd:Q31057 wd:Q35555 wd:Q220982 wd:Q31063 wd:Q475038
  }
  ?entity wdt:P1082 ?population .
  ?entity wdt:P2046 ?area .
  ?entity p:P1082 ?populationStatement .
  ?populationStatement pq:P585 ?populationDate .
  {
    SELECT ?entity ( MAX( ?populationDate ) AS ?maxPopulationDate ) WHERE {
      VALUES ?entity {
        wd:Q884 wd:Q31057 wd:Q35555 wd:Q220982 wd:Q31063 wd:Q475038
      }
      ?entity p:P1082 ?populationStatement .
      ?populationStatement pq:P585 ?populationDate .
    }
    GROUP BY ?entity
  }
  FILTER ( ?populationDate = ?maxPopulationDate )
}

